import styled from '@emotion/styled';

export const NavBarItemContainer = styled.div`
  color: white;
  text-decoration: none;
  cursor: pointer;
  padding: 10px;
  width: 100%;
  display: inline-block;
  transition: all .4s;
  text-align: center;
  &:hover{
    background: #bccbde;
  }
`
